import React from 'react';
import { Box, Link } from 'rebass';

function Button(props) {
    return (
    <div>
        <Link href={props.link}>
            <Box sx={{height:props.height, width:props.width, color:props.color}}>
                some more bullshit
            </Box>

        </Link>
    </div>)

}

export default Button;
